  real function drdx_2b(flag,xindex,xyz,r)
    implicit none
    integer i,j,flag,xindex,xyzind,matom,m
    real::xyz(3,6),r(6,6)

    if (xindex.eq.1) then 
      i = 1
      j = 2
    elseif (xindex.eq.2) then 
      i = 1
      j = 3
    elseif (xindex.eq.3) then 
      i = 1
      j = 4
    elseif (xindex.eq.4) then 
      i = 1
      j = 5
